import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        flexDirection: 'row',
        width: '100%'
    },
    lefContainer: {
        flexDirection: 'row',
    },
    midContainer: {
        flexDirection: 'column',
    },
    avatar: {
        width: 50,
        height: 50,
    }
});

export default styles;
